import Foundation
import CoreGraphics
import Music

extension MusicClef: MusicStaffViewElement {
    
    public func path(in frame: CGRect) -> CGPath {
        switch self {
        case .cClef(_):
            return cClefPath(in: frame)
        case .fClef(_):
            return bassClefPath(in: frame)
        case .gClef(_):
            return trebleClefPath(in: frame)
        }
    }
    
    public var aspectRatio: CGFloat {
        switch self {
        case .gClef(_):
            return 103.0 / 291.0
        case .fClef(_):
            return 310.0 / 370.0
        case .cClef(_):
            return 305.0 / 450.0
        }
    }
    
    public var heightInStaffSpace: CGFloat {
        switch self {
        case .gClef(_):
            return 6.5
        case .fClef(_):
            return 3.5
        case .cClef(_):
            return 4.0
        }
    }
    
    public var anchorPoint: CGPoint {
        switch self {
        case .gClef(_):
            return CGPoint(x: 0.5, y: 0.61);
        case .fClef(_):
            return CGPoint(x: 0.5, y: 110.0/400.0);
        case .cClef(_):
            return CGPoint(x: 0.5, y: 0.5);
        }
    }
    
    public func offset(in clef: MusicClef) -> Int {
        return self.offsetForPitch(named: referencePitch.name, octave: referencePitch.octave)
    }
    
